import React, { Component } from "react";
import { Link, Route } from "react-router-dom";

class AboutUs extends Component {
  resetPush = () => {
    this.props.history.push("/blogs");
  };

  resetReplace = () => {
    this.props.history.replace("/products");
  };

  render() {
    return (
      <div>
        <h1>AboutUs</h1>
        <button onClick={this.resetPush}>Reset Push</button>
        <br />
        <br />
        <button onClick={this.resetReplace}>Reset Replace</button>
        <br />
        <br />
        <ul>
          <li>
            <Link to="/aboutus/drivers">Drivers</Link>
          </li>
          <li>
            <Link to="/aboutus/passengers">Passengers</Link>
          </li>
        </ul>
        <div>
            <Route path="/aboutus/drivers"/>
            <Route path="/aboutus/passengers"/>
        </div>
      </div>
    );
  }
}

export default AboutUs;
